import GymLogo from '../pics/Gym-Logo-Graphics-1-18.jpg';

function Home() {
  return (
  <>

  <div class="title">
  <h1>Gym Management System<span> Ariola </span></h1>
  <img src={GymLogo} alt="Gym Logo" className='small-image' />
</div>
  
    
    </>
  );
}

export default Home;
